import { IonAvatar, IonIcon, IonPage, IonTitle } from '@ionic/react';
import React from 'react';
import './header.css'
import imgas from '../images/Annotation 2024-01-23 201729.png';
import {heartOutline } from 'ionicons/icons';

function Headers(props) {
  return (
    <>
      <div className='header-contaier'>
        <p className='appName'>Photogram</p>
        <img className='HeaderImg' src={imgas} onClick={null}></img>
        <div className='ulHeader'>
          <ul >
            <li className='ul'><i className='gg-add-r'><a href=''>Post</a></i></li>
            <li className='ul'><ion-icon name="heart"><a href=''>Log in</a></ion-icon></li>
            <li className='ul'><i className='gg-add-r'><a href=''>register</a></i></li>
            <li className='ul'><i className='gg-add-r'><a href=''>Edit</a></i></li>
          </ul>
        </div>
      </div>
    </>
  )
}

export default Headers
